import React, { Component } from 'react';

export class Home extends Component {
  static displayName = Home.name;

  render () {
    return (
      <div>
            <h2>Hello, This is Shweta Dalal!<br />
                <br /> </h2>
            <p>I am currently pursuing Masters in Computing and Data Anaytics at SMU.<br />
            I joined MCDA since I am interested in Data Analytics and have previous work experience in it.
            I also want to explore Software Development field. Looking forward to learn at SMU!</p>
        
        </div>
    );
  }
}
